SET ANSI_NULLS ON
SET QUOTED_IDENTIFIER ON
GO

/******************************************************************
 ******************************************************************
 ***
 ***   INSTRUCTIONS:
 ***
 ***   1) Replace {replace_with_DB_name} in the USE statement with
 ***      the name of the Database where SQL# should be installed (line 39)
 ***
 ***   2) Change any of the default settings (lines 45 - 48)
 ***
 ******************************************************************
 ******************************************************************/

/* replace the DB name to add SQL# to your database */
USE [XYZBTRS_SQL]  
GO


DECLARE @SQLsharpSchema SYSNAME, @InstallSQL#OS BIT, @InstallSQL#SgmlReader BIT, @InstallSQL#Twitterizer BIT

SET @SQLsharpSchema = N'SQL#' -- change this value to install SQL# into a different Schema
SET @InstallSQL#OS = 1
SET @InstallSQL#SgmlReader = 1
SET @InstallSQL#Twitterizer = 1

-----------------------------------
IF (OBJECT_ID('tempdb..#SQLsharpOptions') IS NULL)
BEGIN
	CREATE TABLE #SQLsharpOptions ([Option] VARCHAR(50) COLLATE database_default, [Value] VARCHAR(50))
END

RAISERROR('Capturing current Assembly permissions...', 10, 1) WITH NOWAIT
INSERT INTO #SQLsharpOptions ([Option], [Value])
	SELECT	name, CASE permission_set_desc
						WHEN 'SAFE_ACCESS' THEN 'SAFE'
						WHEN 'UNSAFE_ACCESS' THEN 'UNSAFE'
						ELSE permission_set_desc
					END
	FROM	sys.assemblies sa
	LEFT JOIN	#SQLsharpOptions sso
			ON	sso.[Option] = sa.name --COLLATE database_default
	WHERE	sa.name LIKE 'SQL#%'
	AND		sso.[Value] IS NULL
	--AND		sa.permission_set_desc <> 'SAFE_ACCESS'
RAISERROR('', 10, 1) WITH NOWAIT
-----------------------------------

BEGIN TRY

	---
	--- CLR must be enabled
	---
	IF EXISTS (
				SELECT	1
				FROM	sys.configurations conf
				WHERE	conf.configuration_id = 1562 -- "clr enabled"
				AND		conf.value_in_use = 0
			)
	BEGIN
		PRINT 'Enabling the CLR ...'
		PRINT ''

		EXEC('sp_configure ''clr enabled'', 1')

		-- Uncomment the WITH OVERRIDE if you get the "ad hoc changes are not allowed" error
		EXEC('RECONFIGURE --WITH OVERRIDE')
	END
	ELSE
	BEGIN
		PRINT 'CLR already enabled; skipping'
		PRINT ''
	END

	---
	--- If SQL# already exists, uninstall it
	---
	DECLARE @CurrentSQLsharpSchema SYSNAME

	SELECT	@CurrentSQLsharpSchema = routine.ROUTINE_SCHEMA
	FROM	INFORMATION_SCHEMA.ROUTINES routine
	WHERE	routine.SPECIFIC_NAME = 'SQLsharp_Uninstall'

	IF (@CurrentSQLsharpSchema IS NOT NULL)
	BEGIN
		PRINT 'Uninstalling previous install of SQL# . . .'
		EXEC('EXEC [' + @CurrentSQLsharpSchema + '].[SQLsharp_Uninstall]')
		PRINT 'SQL# Uninstalled'
		PRINT ''
	END

	---
	--- Make sure that the Schema desired to hold SQL# exists
	---
	DECLARE @SQL NVARCHAR(4000)

	IF NOT EXISTS (
					SELECT	1
					FROM	INFORMATION_SCHEMA.SCHEMATA schemas
					WHERE	schemas.SCHEMA_NAME = @SQLsharpSchema
				)
	BEGIN
		PRINT ''
		PRINT 'Creating Schema: [' + @SQLsharpSchema + '] ...'

		SET @SQL = N'CREATE SCHEMA [' + @SQLsharpSchema + N'] AUTHORIZATION [dbo]'
		EXEC(@SQL)

		PRINT 'Schema Created'
		PRINT ''
	END
	ELSE
	BEGIN
		PRINT 'Schema [' + @SQLsharpSchema + '] already exists; skipping'
		PRINT ''
	END

	---
	--- Create the main SQL# Assembly
	---
	PRINT 'Creating SQL# Assembly ...'

	CREATE ASSEMBLY [SQL#]
	AUTHORIZATION [dbo]
FROM \
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\
\

	WITH PERMISSION_SET = SAFE
	PRINT 'SQL# Assembly Created'
	PRINT ''


	IF (@InstallSQL#OS = 1)
	BEGIN
		PRINT 'Creating SQL#.OS Assembly ...'
		EXEC('
			CREATE ASSEMBLY [SQL#.OS]
			AUTHORIZATION [dbo]
FROM \

			WITH PERMISSION_SET = SAFE
			')
		PRINT 'SQL#.OS Assembly Created'
	END
	ELSE
	BEGIN
		PRINT 'Skipping install of SQL#.OS Assembly.'
	END
	PRINT ''


	IF (@InstallSQL#Twitterizer = 1)
	BEGIN
		PRINT 'Creating SQL#.Twitterizer Assembly ...'
		EXEC('
			CREATE ASSEMBLY [SQL#.Twitterizer]
			AUTHORIZATION [dbo]
FROM \
\
\
\
\
\
\
\
\
\
\

			WITH PERMISSION_SET = SAFE
			')
		PRINT 'SQL#.Twitterizer Assembly Created'
	END
	ELSE
	BEGIN
		PRINT 'Skipping install of SQL#.Twitterizer Assembly.'
	END
	PRINT ''


	IF (@InstallSQL#SgmlReader = 1)
	BEGIN
		PRINT 'Creating SQL#.SgmlReader Assembly ...'
		EXEC('
			CREATE ASSEMBLY [SQL#.SgmlReader]
			AUTHORIZATION [dbo]
FROM \
\
\
\
\

			WITH PERMISSION_SET = SAFE
			')
		PRINT 'SQL#.SgmlReader Assembly Created'
	END
	ELSE
	BEGIN
		PRINT 'Skipping install of SQL#.SgmlReader Assembly.'
	END
	PRINT ''


	IF NOT EXISTS (
					SELECT	1
					FROM	sys.module_assembly_usages mau
					INNER JOIN	sys.assemblies asmbly
							ON	asmbly.assembly_id = mau.assembly_id
							AND	asmbly.name = 'SQL#'
					INNER JOIN	sys.objects so
							ON	so.object_id = mau.object_id
					WHERE	so.name = 'SQLsharp_Setup'
				)
	BEGIN
		PRINT 'Creating Setup Procedure ...'
		PRINT ''
		EXEC('CREATE PROCEDURE [' + @SQLsharpSchema + '].[SQLsharp_Setup] @SQLsharpSchema NVARCHAR(128) = ''SQL#'' WITH EXECUTE AS CALLER AS EXTERNAL NAME [SQL#].[SQLsharp].[Setup]')
		PRINT 'Setup Procedure Created'
		PRINT ''
	END
	ELSE
	BEGIN
		PRINT 'Setup Procedure already exists; skipping ...'
		PRINT ''
	END


	PRINT 'Running Setup Procedure ...'
	EXEC ('[' + @SQLsharpSchema + '].[SQLsharp_Setup] ''' + @SQLsharpSchema + '''')


	PRINT ''
	PRINT 'Setup Procedure Completed'
	PRINT ''

	IF (EXISTS(SELECT * FROM #SQLsharpOptions))
	BEGIN

		DECLARE	@Option VARCHAR(50),
				@Value	VARCHAR(50)
				
		DECLARE	opt_cur CURSOR STATIC LOCAL FOR
			SELECT	sso.[Option], sso.[Value]
			FROM	#SQLsharpOptions sso
			INNER JOIN	sys.assemblies sa
					ON	sa.[name] = sso.[Option] --COLLATE database_default
			WHERE	sso.[Value] <> 'SAFE'
			ORDER BY	sa.[name]

		OPEN opt_cur
		
		FETCH	NEXT
		FROM	opt_cur
		INTO	@Option, @Value
		
		WHILE (@@FETCH_STATUS = 0)
		BEGIN
			RAISERROR('Resetting [%s] permissions to be: %s ...', 10, 1, @Option, @Value) WITH NOWAIT
			EXEC ('ALTER ASSEMBLY [' + @Option + '] WITH PERMISSION_SET = ' + @Value)

			FETCH	NEXT
			FROM	opt_cur
			INTO	@Option, @Value
		END
		
		CLOSE opt_cur
		DEALLOCATE opt_cur
	END

	PRINT ''
	PRINT 'SQL# Installed!!'
	PRINT ''


END TRY
BEGIN CATCH

	IF (CURSOR_STATUS('local', 'opt_cur') >= 0)
	BEGIN
		CLOSE opt_cur
		DEALLOCATE opt_cur
	END

	DECLARE @ErrorMessage NVARCHAR(MAX)
	SET @ErrorMessage = 'Line ' + CONVERT(VARCHAR(20), ERROR_LINE())
						+ ', Msg ' + CONVERT(VARCHAR(20), ERROR_NUMBER())
						+ ': ' + ERROR_MESSAGE()
	RAISERROR(@ErrorMessage, 16, 1)
	PRINT ''
	PRINT ''
	RAISERROR('SQL# did NOT install successfully. Please see error messages above.', 16, 1)
	RETURN

END CATCH
GO
